  summary: "\nReads in a stream of objects where the objects were serialized as a series of Xml fragments\nThe stream MUST have been written with an ObjectWriter.\n\nThis stream is NOT RESTARTABLE - as in, Rollback won't work after a process is aborted. \nXmlReader is a buffering reader by default,  so we cannot use checkpoints of stream positions as a reliable means of rolling back \na file operation. The stream position does NOT tell us how much XmlReader had actually read. Consequently, you cannot start reading \nwhere you left off. You always have to RESTART this stream...\nIf you need the Restart property, use a RestartableObjectReader/Writer pair\n\n"
